-- -----------------------------------------------------
-- Schema globex
-- -----------------------------------------------------
CREATE SCHEMA IF NOT EXISTS `globex` DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci ;

USE `globex` ;

-- -----------------------------------------------------
-- Table `globex`.`Products`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`Products` ;

CREATE TABLE IF NOT EXISTS `globex`.`Products` (
    `productId` INT AUTO_INCREMENT PRIMARY KEY,
    `productName` VARCHAR(200) NOT NULL,
    `description` TEXT,
    `price` DECIMAL(10, 2) NOT NULL,
    `stock` INT NOT NULL,
    `categoryID` INT,
    `createdAt` TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    `image` LONGBLOB NULL DEFAULT NULL,
    FOREIGN KEY (`categoryID`) REFERENCES `globex`.`Categories`(`categoryID`),
    INDEX `idx_categoryID` (`categoryID`), -- Add an index for categoryID for faster joins
    INDEX `idx_productName` (`productName`) -- Add an index for productName for faster searches
) ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;


-- -----------------------------------------------------
-- Table `globex`.`Categories`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`Categories` ;

CREATE TABLE IF NOT EXISTS `globex`.`Categories` (
    `categoryID` INT AUTO_INCREMENT PRIMARY KEY,
    `categoryName` VARCHAR(200) NOT NULL UNIQUE,
    `description` TEXT
) ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;


-- -----------------------------------------------------
-- Table `globex`.`OrderDetails`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`OrderDetails` ;

CREATE TABLE IF NOT EXISTS `globex`.`OrderDetails` (
    `orderId` INT AUTO_INCREMENT PRIMARY KEY,
    `transactionId` INT NOT NULL,
    `productId` INT NOT NULL,
    `quantity` INT NOT NULL DEFAULT 0,
    `price` DECIMAL(10, 2) NOT NULL,
    `shipped` INT NOT NULL DEFAULT 0,
    INDEX `productid_idx` (`productId` ASC),
    CONSTRAINT `fk_transaction`
        FOREIGN KEY (`transactionId`)
        REFERENCES `globex`.`Transactions` (`transactionId`)
        ON DELETE NO ACTION
        ON UPDATE NO ACTION,
    CONSTRAINT `fk_product`
        FOREIGN KEY (`productId`)
        REFERENCES `globex`.`Products` (`productId`)
        ON DELETE NO ACTION
        ON UPDATE NO ACTION
) ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- -----------------------------------------------------
-- Table `globex`.`Reviews`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`Reviews` ;

CREATE TABLE IF NOT EXISTS `globex`.`Reviews` (
    `reviewId` INT AUTO_INCREMENT PRIMARY KEY,
    `productId` INT NOT NULL,
    `userId` INT NOT NULL,
    `rating` INT CHECK (rating BETWEEN 1 AND 5),
    `comment` TEXT,
    `reviewDate` TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (`productId`) REFERENCES `globex`.`Products` (`productId`),
    FOREIGN KEY (`userId`) REFERENCES `globex`.`Users` (`userId`)
) ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- -----------------------------------------------------
-- Table `globex`.`Users`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`Users` ;

CREATE TABLE IF NOT EXISTS `globex`.`Users` (
    `userId` INT AUTO_INCREMENT PRIMARY KEY,
    `email` VARCHAR(100) NOT NULL UNIQUE,
    `firstName` VARCHAR(50),
    `lastName` VARCHAR(50),
    `mobile` BIGINT NULL DEFAULT NULL,
    `address` VARCHAR(250) NULL DEFAULT NULL,
    `postcode` INT NULL DEFAULT NULL,
	`password` VARCHAR(200) NULL DEFAULT NULL,
    `passwordHash` VARCHAR(255) NOT NULL,
    `createdAt` TIMESTAMP DEFAULT CURRENT_TIMESTAMP
) ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;




ALTER TABLE globex.users
