RENAME COLUMN mobile TO mobileNumber;



-- -----------------------------------------------------
-- Table `globex`.`Transactions`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`Transactions` ;

CREATE TABLE IF NOT EXISTS `globex`.`Transactions` (
    `transactionId` INT AUTO_INCREMENT PRIMARY KEY,
    `userId` INT NOT NULL,
    `totalAmount` DECIMAL(10, 2) NOT NULL,
    `transactionDate` TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    INDEX `truserid_idx` (`userId` ASC),
    CONSTRAINT `fk_user_transaction`
        FOREIGN KEY (`userId`)
        REFERENCES `globex`.`Users` (`userId`)
        ON DELETE NO ACTION
        ON UPDATE NO ACTION
) ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- -----------------------------------------------------
-- Table `globex`.`UserDemand`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`UserDemand` ;

CREATE TABLE IF NOT EXISTS `globex`.`UserDemand` (
    `userId` INT NOT NULL,
    `productID` INT NOT NULL,
    `quantity` INT NULL DEFAULT NULL,
    PRIMARY KEY (`userId`, `productID`),
    INDEX `idx_productID` (`productID` ASC),
    CONSTRAINT `fk_user_email`
        FOREIGN KEY (`userId`)
        REFERENCES `globex`.`Users` (`userId`)
        ON DELETE NO ACTION
        ON UPDATE NO ACTION,
    CONSTRAINT `fk_productID`
        FOREIGN KEY (`productID`)
        REFERENCES `globex`.`Products` (`productId`)
        ON DELETE NO ACTION
        ON UPDATE NO ACTION
) ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- -----------------------------------------------------
-- Table `globex`.`ShoppingCart`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`ShoppingCart` ;

CREATE TABLE IF NOT EXISTS `globex`.`ShoppingCart` (
    `cartID` INT AUTO_INCREMENT PRIMARY KEY,
    `userId` INT NOT NULL,
    `createdAt` TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    INDEX `idx_userId` (`userId` ASC),
    CONSTRAINT `fk_user_cart`
        FOREIGN KEY (`userId`)
        REFERENCES `globex`.`Users` (`userId`)
        ON DELETE NO ACTION
        ON UPDATE NO ACTION
) ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- -----------------------------------------------------
-- Table `globex`.`CartItems`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`CartItems` ;

CREATE TABLE IF NOT EXISTS `globex`.`CartItems` (
    `itemID` INT AUTO_INCREMENT PRIMARY KEY,
    `cartID` INT NOT NULL,
    `productID` INT NOT NULL,
    `quantity` INT NOT NULL,
    CONSTRAINT `fk_cart_item`
        FOREIGN KEY (`cartID`)
        REFERENCES `globex`.`ShoppingCart` (`cartID`)
        ON DELETE CASCADE
        ON UPDATE NO ACTION,
    CONSTRAINT `fk_item_product`
        FOREIGN KEY (`productID`)
        REFERENCES `globex`.`Products` (`productId`)
        ON DELETE NO ACTION
        ON UPDATE NO ACTION
) ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- -----------------------------------------------------
-- Table `globex`.`PaymentDetails`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`PaymentDetails` ;

CREATE TABLE IF NOT EXISTS `globex`.`PaymentDetails` (
    `paymentId` INT AUTO_INCREMENT PRIMARY KEY,
    `transactionId` INT NOT NULL,
    `paymentMethod` VARCHAR(50),
    `paymentStatus` VARCHAR(50),
    `paymentDate` TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT `fk_payment_transaction`
        FOREIGN KEY (`transactionId`)
        REFERENCES `globex`.`Transactions` (`transactionId`)
        ON DELETE NO ACTION
        ON UPDATE NO ACTION
) ENGINE=InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- -----------------------------------------------------
-- Table `globex`.`Wishlist`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`Wishlist` ;

CREATE TABLE IF NOT EXISTS `globex`.`Wishlist` (
    `wishlistId` INT AUTO_INCREMENT PRIMARY KEY,
    `userId` INT NOT NULL,
    `createdAt` TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    INDEX `idx_userId_wishlist` (`userId` ASC),
    CONSTRAINT `fk_user_wishlist`
        FOREIGN KEY (`userId`)
        REFERENCES `globex`.`Users` (`userId`)
        ON DELETE NO ACTION
        ON UPDATE NO ACTION
) ENGINE=InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- -----------------------------------------------------
-- Table `globex`.`WishlistItems`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `globex`.`WishlistItems` ;

CREATE TABLE IF NOT EXISTS `globex`.`WishlistItems` (
